import React from 'react';

const About = () => {
  return (
    <div className='bg-red-100'>
      <h1 className='flex items-center mx-auto justify-center my-4'>About</h1>
        <div className='p-12 border'> 
          <h1 className='text-4xl text-white'>Judul</h1>
        </div>
        <div className='border flex justify-center p-10'>
          <h1 className='text-white'>lorem ipsum </h1>
        </div>
    </div>
  )
}

export default About;
